import React from "react";

const Submit = () => {
  return (
    <div className="flex-row-align div-center-h gap-05">
      <div
        className="bg-block-primary pad-1 wide-font border-round-s border-color-augment font-size-s"
        onClick={this.updateWallet}
      >
        Submit
      </div>
      <div className="bg-block-primary pad-1 wide-font border-round-s border-color-augment font-size-s">
        Reset
      </div>
    </div>
  );
};

export default Submit;
